//SPDX-License-Identifier: UNLICENSED

// Solidity files have to start with this pragma.
// It will be used by the Solidity compiler to validate its version.
pragma solidity ^0.8.7;

// We import this library to be able to use console.log
import "hardhat/console.sol";

// This is the main building block for smart contracts.
contract Will {
    struct WillData {
        uint256 id;
        address owner; // Represented by the ownerUserId
        string title;
        uint256 createdAt;
        uint256 updatedAt;
        bool isActive;
        bool isValidated;
        uint256 deployedAt;
        string deployedAtBlock;
    }

    mapping(uint256 => WillData) public wills; // Mapping to store WillData

    uint256 public willCount;

    constructor() {
        willCount = 0;
    }

    // to support receiving ETH by default
    receive() external payable {}

    fallback() external payable {}

    function getWill(uint256 id) public view returns (WillData memory) {
        return wills[id];
    }

    function createWill(
        address owner,
        string memory title,
        uint256 createdAt,
        uint256 updatedAt,
        bool isActive,
        bool isValidated,
        uint256 deployedAt,
        string memory deployedAtBlock
    ) public {
        willCount++;
        wills[willCount] = WillData(
            willCount,
            owner,
            title,
            createdAt,
            updatedAt,
            isActive,
            isValidated,
            deployedAt,
            deployedAtBlock
        );
    }

    function updateWill(
        uint256 id,
        string memory newTitle,
        bool newIsValidated
    ) public {
        require(id <= willCount, "Invalid Will ID");
        WillData storage will = wills[id];
        will.title = newTitle;
        will.isValidated = newIsValidated;
    }
}

